import React, { Component } from "react";
import SearchBar from "./components/SearchBar";
import ToDoList from "./components/ToDoList";

class App extends Component {
  state = {
    todo: "",
    todos: [],
  };
  render() {
    return (
      <div className="container mt-4 text-center">
        <SearchBar />
        <ToDoList />
      </div>
    );
  }
}

export default App;
